import { Card, Container, makeStyles, CardContent } from "@material-ui/core"
import Feed from "../components/Feed"
import CreatePost from "./CreatePost"

const useStyles = makeStyles((theme) => ({
  container: {
    marginTop: theme.spacing(4),
  },
}))

const FeedPage = () => {
  const classes = useStyles()

  const getFeed = () => {
    return [
      {
        id: 1,
        poster: "Adam Rodrigues",
        post:
          "Enim sunt laboris consequat id anim reprehenderit ipsum. Veniam elit tempor adipisicing adipisicing incididunt irure laborum enim id aute. Nostrud qui irure est ad ex non non proident minim eu.",
        comments: 2,
        likes: 1,
      },
      {
        id: 2,
        poster: "Adam Rodrigues",
        post:
          "Enim sunt laboris consequat id anim reprehenderit ipsum. Veniam elit tempor adipisicing adipisicing incididunt irure laborum enim id aute. Nostrud qui irure est ad ex non non proident minim eu.",
        comments: 2,
        likes: 1,
      },
      {
        id: 3,
        poster: "Adam Rodrigues",
        post:
          "Enim sunt laboris consequat id anim reprehenderit ipsum. Veniam elit tempor adipisicing adipisicing incididunt irure laborum enim id aute. Nostrud qui irure est ad ex non non proident minim eu.",
        comments: 2,
        likes: 1,
      },
    ]
  }

  return (
    <Container className={classes.container} maxWidth="md">
      {getFeed().map((post) => {
        return (
          <Feed
            poster={post.poster}
            post={post.post}
            comments={post.comments}
            likes={post.likes}
          />
        )
      })}
    </Container>
  )
}

export default FeedPage
